import React, { Component } from 'react';
import logo from '../assets/svg/logo-softvu.svg';
import iconCode from '../assets/svg/icon-code.svg';
import iconComputer from '../assets/svg/icon-computer.svg';
import iconLightbulb from '../assets/svg/icon-lightbulb.svg';
import iconPhone from '../assets/svg/icon-phone.svg';

export class Nav extends Component {
    render() {
      return (
        <nav id="nav">
            <img src={logo} onClick={this.props.onClick} className="App-logo" alt="logo" id="about" />
            <div className="nav-icon-container">
                <img onClick={this.props.onClick} src={ iconCode } alt="Coding Projects" id="email" className="nav-icon"/>
                <img onClick={this.props.onClick} src={ iconComputer } alt="Coding Projects" id="landingpages" className="nav-icon"/>
                <img onClick={this.props.onClick} src={ iconLightbulb } alt="Coding Projects" id="experiment" className="nav-icon"/>
                <img onClick={this.props.onClick} src={ iconPhone } alt="Coding Projects" id="animation" className="nav-icon"/>
                <svg onClick={this.props.onClick} src={ iconPhone } alt="Coding Projects" id="animation" className="nav-icon" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 65.61 53.44">
                  <title>Asset 2</title>
                    <g id="Layer_2" data-name="Layer 2">
                      <g id="Õ__1" data-name="Õº≤„_1">
                        <g>
                          <path class="cls-1" d="M61.49,0H4.12A4.13,4.13,0,0,0,0,4.12v45.2a4.13,4.13,0,0,0,4.12,4.12H61.49a4.13,4.13,0,0,0,4.12-4.12V4.12A4.13,4.13,0,0,0,61.49,0ZM4.12,4H61.49a.13.13,0,0,1,.12.12V13H4V4.12A.13.13,0,0,1,4.12,4ZM61.49,49.44H4.12A.13.13,0,0,1,4,49.32V17H61.61V49.32A.13.13,0,0,1,61.49,49.44Z"/>
                          <path class="cls-1" d="M18.38,10.62a2.21,2.21,0,1,0-2.21-2.21A2.21,2.21,0,0,0,18.38,10.62Z"/>
                          <path class="cls-1" d="M26,10.62A2.21,2.21,0,1,0,23.8,8.41,2.21,2.21,0,0,0,26,10.62Z"/>
                          <path class="cls-1" d="M10.75,10.62A2.21,2.21,0,1,0,8.54,8.41,2.21,2.21,0,0,0,10.75,10.62Z"/>
                          <polygon class="cls-1" points="11.88 34.88 24.87 40.46 24.87 36.11 17.73 33.05 24.87 29.98 24.87 25.63 11.88 31.21 11.88 34.88"/>
                          <polygon class="cls-1" points="40.74 29.98 47.88 33.05 40.74 36.11 40.74 40.46 53.73 34.88 53.73 31.21 40.74 25.63 40.74 29.98"/>
                          <polygon class="cls-1" points="28.62 42.49 32.73 42.49 37.15 23.56 33.04 23.56 28.62 42.49"/>
                        </g>
                      </g>
                    </g>
                  </svg>


            </div>
        </nav>
      );
    }
  }
